const apiKey = "b7d3bda1e0818bb4b407638b5d0b4006";
const imgPath = "https://image.tmdb.org/t/p/w1280";

function App() {
  const [inputValue, setInputValue] = useState();
  return (
    <div>
      <input
        type="text"
        onChange={(e) => {
          setInputValue(e.target.value);
        }}
      ></input>
      <button>Search</button>
      {inputValue}
    </div>
  );
}

export default App;
